import { __assign } from "tslib";
import event from './event';
import { repTypes } from '../../config';
import pageData from '../../share/pageData';
/** 页面离开 */
export default function pageExit(metaId, extra) {
    var durationTime = Math.ceil((+new Date - pageData.time) / 1000);
    return event.bind(this)(metaId, repTypes.UBT.subTypes.PAGE_EXIT, __assign({ durationTime: durationTime, currPage: pageData.prevPage }, extra), true);
}
